create table characters_jobs
(
    Id                   int auto_increment
        primary key,
    OwnerId              int     not null,
    TemplateId           int     not null,
    Experience           bigint  not null,
    WorkForFree          tinyint not null,
    MinLevelCraftSetting int     not null
)
    engine = MyISAM
    charset = utf8;

create index OwnerId
    on characters_jobs (OwnerId);

